import React from "react";
import { NavLink } from 'react-router-dom'
import '../assets/jumbo.css'
const Jumbo = () => {
    return (
        <div className="jumbo">
            <h1>Experience Geneva</h1>
            <video width="100%" height="500px" controls="controls">
                <source src="https://youtu.be/fZ8h9Ed_64U" type="video/mp4" />
            </video>
        </div> 
    )
}

export default Jumbo
